INSERT INTO `yingin192` (`yingin192_id`, `goodorbad`, `mean`, `point`, `thousand_num`) VALUES
(1, '上上', '得意宜逢貴，前程去有緣。利名終有望，三五月團圓', '', '112'),
(2, '中中', '欲行不止，徘徊不已。藏玉懷珠，片帆千里', '', '114'),
(3, '下下', '心戚戚口啾啾，一番思量，一番憂，說了休時又不休', '', '116'),
(4, '上中', '不遠不近，似易似難。等閑入手，雲中笑看', '', '121'),
(5, '下下', '桃李謝春風，西去又復東。家中無意緒，船在浪濤中', '', '123'),
(6, '中中', '狂風吹起黑雲飛，月在天心遮不得。時閑無事暫相關，到底依然無刻剝', '', '125'),
(7, '上上', '心和同，事和同。門外好施工，交加事有終', '', '132'),
(8, '中平', '意孜孜，心戚戚。要平安，防出入', '', '134'),
(9, '上中', '一水繞一水，一山繞一山。水盡山窮處，名利不為難', '', '136'),
(10, '上上', '事扛扶，在半途。翻覆終可免，風波一點無', '', '141'),
(11, '下下', '淺水起波瀾，平地生荊棘，言語虛參商，猶恐無端的', '', '143'),
(12, '上上', '喜喜喜，春風生桃李。不用強憂煎，明月人千里', '', '145'),
(13, '下中', '欲濟未濟，欲求強求。心無一定，一車兩頭', '', '152'),
(14, '下下', '居下當親上，人心易散難。事械才一失，萬事盡皆滅', '', '154'),
(15, '下下', '見不見，也防人背面。遇不遇，到底無憑據', '', '156'),
(16, '上中', '嘹嚦征鴻獨出群，高飛羽翼更斜云。分程正北堪圖進，好個聲名處處聞', '', '161'),
(17, '上中', '貴客相逢便可期，庭前枯木鳳來儀。好將短事求長事，休聽旁人說是非', '', '163'),
(18, '上上', '檐煎鵲噪正翩翩，憂慮洗消喜自然。一人進了一人退，下梢終有好姻緣', '', '165'),
(19, '中中', '兀兀塵埃又待時，幽幽靜處有誰知?若逢青紫人相引，財利功名自可期', '', '172'),
(20, '上中', '一得一慮，宜后欲先。路通大道，心事安然', '', '174'),
(21, '上上', '一番桃李一番新，誰識陽和氣象明。林下水邊多活計，見山了了稱人情', '', '176'),
(22, '上中', '相引更相牽，殷勤喜自然。施為無不利，愁事變團圓', '', '181'),
(23, '下下', '無蹤又無跡，遠近終難覓。平地起風雲，似笑還成泣', '', '183'),
(24, '下下', '身不安，心不安。動靜兩三年，終期事必歡', '', '185'),
(25, '上上', '玉出昆崗石，舟離古渡灘。行藏終有望，用捨不為難', '', '222'),
(26, '下下', '難難難，忽然平地起波瀾。易易易，談笑平常終有忌', '', '224'),
(27, '下下', '	\r\n樂之極矣悲相望，引兌來兮吉與凶。未能光大終須暗，日落西山返照中', '', '226'),
(28, '下中', '神黯黯，意悠悠。收卻線，莫下鈎', '', '211'),
(29, '中平', '	\r\n虎伏在前途，行人莫亂呼。路旁須仔細，災禍自然無', '', '213'),
(30, '下下', '所事縱云難，平地起波瀾。笑談終有忌，事回心覺喜', '', '215'),
(31, '下中', '意迷心不迷，事寬心不寬。要知端的事，猶隔兩重山', '', '231'),
(32, '中中', '道路迢遙，門庭閉塞。雪擁未分明，雲開方見日', '', '233'),
(33, '上中', '虎變高山別有期，望人目下尚狐疑。雁來嘹嚦黃花飛，此際聲名達帝畿', '', '235'),
(34, '中平', '	\r\n一事已成空，一事還成喜。若遇口邊人，心下堪憑委', '', '242'),
(35, '下中', '魚上鈎，絲綸弱。收拾難，力再著', '', '244'),
(36, '上上', '可蓄可儲，片玉寸珠，停停穩穩，前遇良圖', '', '246'),
(37, '中中', '心有餘，力不足。倚仗春風，一歌一曲', '', '251'),
(38, '下下', '荊棘生平地，風波起四方。倚欄惆悵望，無語對斜陽', '', '253'),
(39, '中中', '一人兩事，一人兩心。新花枯樹，須待交春', '', '255'),
(40, '上中', '足不安，心不安。兩兩事相待，憂來卻又歡', '', '262'),
(41, '上中', '目下志難舒，有客來徐徐。金車雖歷險，吝必有終歟', '', '264'),
(42, '下下', '缺月恐難圓，殘花不再鮮。苦求名與利，到處遇迍邅', '', '266'),
(43, '中中', '	\r\n意在關中信未來，故人千里自徘徊。天邊雁足傳書至，一點梅花喜色開', '', '271'),
(44, '下下', '休道事無訛，其中進退多。桂輪圓又缺，光彩更楷磨', '', '273'),
(45, '下中', '事了物未了，人圓物未圓。要知端的信，月影上欄杆', '', '275'),
(46, '上中', '美中生不足，內外見愁哭。雲散月光輝，轉禍當成福', '', '282'),
(47, '中中', '言語參商，波濤鼎沸。事久無傷，時間不利', '', '284'),
(48, '中中', '無非應有忌，未為先恐躓。路險風波事更非，要得稱心須借勢', '', '286'),
(49, '上上', '謀已定，事何憂。明月上重樓，雲中客點頭', '', '332'),
(50, '下下', '遇不遇，逢不逢。月沉水底，人在夢中', '', '334'),
(51, '上中', '	\r\n誅戰中邦利出征，一朝獲丑在王庭。鳳銜一詔堤楊畔，得個佳名四海榮', '', '336'),
(52, '上中', '一重水，一重山，風波道坦然，壺中別有天', '', '312'),
(53, '上上', '遇險不為憂，風波何足懼。若遇草頭人，咫尺青雲路', '', '314'),
(54, '上上', '奇奇奇，地利與天時。燈花傳信後，動情總相宜', '', '316'),
(55, '下中', '上下分，憂愁決。千嶂雲，一輪月', '', '321'),
(56, '下下', '	\r\n鼎沸風波，孤舟渡河。巧中藏拙，人事蹉跎', '', '323'),
(57, '下中', '船棹中流急，花開春又遲。事寧心不靜，惹起許多疑', '', '325'),
(58, '上中', '人倚樓，許多愁。淡然進步，事始無憂', '', '341'),
(59, '上中', '暗中防霹靂，猜疑渾未實。轉眼黑雲收，擁出扶桑日', '', '343'),
(60, '下下', '堪嘆枕邊憂，更嗟門裡鬧。意緒甚索纏，心神亦顛倒', '', '345'),
(61, '上上', '小子出門庭，青衣久問程。貴人來助力，花謝子還成', '', '352'),
(62, '下中', '	\r\n芰荷香里許恩財，桂魄圓時印綬來。從此威名山岳重，光輝玉節位三台', '', '354'),
(63, '上上', '貴客自相親，功名唾手成。獲金須積德，仰望太陽升', '', '356'),
(64, '中中', '桑榆催晚景，缺月恐難圓。若遇刀錐客，方知有喜緣', '', '361'),
(65, '下中', '萬里片帆輕，波平浪不驚。行行無阻滯，遠慮更通津', '', '363'),
(66, '上上', '芰荷香里許恩財，桂魄圓時印綬來。從此威名山岳重，光輝玉節位三台', '', '365'),
(67, '上上', '悲臉笑顏開，秋月掛高台，人從千里來', '', '372'),
(68, '中中', '花落正逢春，行人在半程。事成還不就，索絆兩三旬', '', '374'),
(69, '中中', '憔悴無人問，林間聽杜鵑。一聲山月笛，千里暗銷魂', '', '376'),
(70, '上中', '須著力，莫遨遊。長竿釣向蟾蜍窟，真欲雲中得巨鰲', '', '381'),
(71, '上上', '兩兩意和同，輕帆遇順風。道途人得意，歌唱急流中', '', '383'),
(72, '中中', '萬里涉江山，風波盡日閑。已吞釣上餌，何必遇波瀾', '', '385'),
(73, '下下', '無蹤又無跡，遠近終難覓。旱海莫行舟，何勞空著力', '', '442'),
(74, '上中', '白玉隱塵，黃金埋土。久久光輝，也要人舉', '', '444'),
(75, '下中', '細雨濛濛濕，江邊人不通。道途人未達，憑仗借東風', '', '446'),
(76, '下下', '江闊渡無船，驚濤恐拍天。月斜雲淡處，音信有人傳', '', '411'),
(77, '下中', '平地起風煙，時下未能安，高處覓因緣', '', '413'),
(78, '下中', '正直宜守，妄動生災。名通利達，葉落花開', '', '415'),
(79, '下中', '門外事重疊，陰人多遇合。賢女雖助巧，渺渺終難洽', '', '422'),
(80, '中中', '缺月重圓，枯枝又鮮。一條坦路，翹首青天', '', '424'),
(81, '中中', '美紅顏，休掛懷。人在車中，舟行海底', '', '426'),
(82, '上中', '過盡風波三五重，誰知浪盡又無風。須知明達青雲路，用舍行藏不費功', '', '431'),
(83, '下下', '紛紛復紛紛，欷噓獨掩門。斂眉望燈火，伴我坐黃昏', '', '433'),
(84, '下中', '門內佳音來，生涯應有慶。名利有更遷，雁行終拆陣', '', '435'),
(85, '下下', '深潭月，明鏡影。一場空，妄報信', '', '451'),
(86, '下下', '橋已斷，路不通。登舟理楫，又遇狂風', '', '453'),
(87, '下下', '湖水悠悠，孤舟浪頭。來人未識，殘月山樓', '', '455'),
(88, '上上', '萬里波濤靜，一天風雨閑。利名無阻隔，行路出重關', '', '462'),
(89, '上上', '湖海意悠悠，煙波下釣鈎。若逢龍與兔，名利一齊周', '', '464'),
(90, '上中', '一箭青雲路，營求指日成。許多閑口語，翻作笑歌聲', '', '466'),
(91, '下下', '物不牢，人斷橋。重整理，慢心高', '', '471'),
(92, '下下', '深戶要牢扃，須防暗裡人。莫言無外事，縱好定遭迍', '', '473'),
(93, '上上', '空空空，空裡得成功。蟠桃千載熟，不怕五更風', '', '475'),
(94, '中中', '鑿石得玉，淘沙得珠。眼前目下，何用躊躇', '', '482'),
(95, '上上', '名成利遂勿憂煎，菊裡秋風道坦然。得意便垂三尺釣，長竿獲得錦鱗鮮', '', '484'),
(96, '下下', '獨釣寒潭澗，中途興已闌。水寒魚不餌，小艇月明還', '', '486'),
(97, '下下', '	\r\n下著占先機，其中路不迷。目前無含意，爭免是和非', '', '552'),
(98, '上上', '江海悠悠，煙波下鈎。六鰲連獲，歌笑中流', '', '554'),
(99, '下下', '一月圓，一鏡缺。少團圓，無可說', '', '556'),
(100, '下中', '金鱗入手，得還防走。若論周旋，謹慎戒口', '', '512'),
(101, '中中', '上下不和同，勞而未有功。出門通大道，從此何初終', '', '514'),
(102, '上中', '凝欲遷而未可遷，提防喜處惹勾，前途若得陰人引，變化魚龍出大淵', '', '516'),
(103, '上中', '一點著陽春，枯(枝)枝朵朵榮。志專方遇合，初忌二三心', '', '521'),
(104, '中中', '欲行遷止，徘徊不已。動搖莫強，得止且止', '', '523'),
(105, '上上', '傾一杯，轉愁眉。天地合，好施為', '', '525'),
(106, '下中', '一鏡破，照兩人。心中結，合同心', '', '532'),
(107, '上上', '珠玉走盤中，田園足阜豐。休言謀未遂，此去一時通', '', '534'),
(108, '上中', '	\r\n心下事悠然，周旋尚未全。遇龍終有吉，人月永團圓', '', '536'),
(109, '上中', '大事可成功，有益還無咎。雲內執鞭人，報在三秋後', '', '541'),
(110, '下下', '無蹤又無跡，遠近終難覓。旱海莫行舟，何勞空費力', '', '543'),
(111, '上上', '子結花殘，花開枯樹。屋頭春意喜，笑嘻嘻', '', '545'),
(112, '上上', '雲靜日當中，光輝到處通。道途逢水順，千里快如風', '', '561'),
(113, '中中', '望處應重山，高深漸可攀。舉頭天上看，明月出入間', '', '563'),
(114, '中中', '不歸一，勞心力。貴人旁，宜借力', '', '565'),
(115, '上上', '閬苑一時春，庭前花柳新。鵲聲傳好信，草木盡欣欣', '', '572'),
(116, '上上', '欲捉月中兔，須憑桃李梯。高山來接引，雙喜照雙眉', '', '574'),
(117, '中中', '意迷心不迷，事寬心不寬。一場雙喜會，不久出重關', '', '576'),
(118, '下下', '野鬼暗張弧，射中主人驚。紅日沉紅海，空中事不成', '', '581'),
(119, '上上', '雙燕銜書舞，指日一齊來。寂寞淹留客，從茲下釣台', '', '583'),
(120, '下中', '雲靉靉，月朦朧。一雁入雲中，殘花謝曉風', '', '585'),
(121, '下中', '夢裡說江水，波深下釣難。利名終有望 ，目下未開顏', '', '662'),
(122, '上上', '莫怪事遲留，休言不到頭。長竿終入手，一釣上金鈎', '', '664'),
(123, '下下', '疑疑疑，一番笑後一番悲。落紅滿地無人掃，獨對西風扶黛眉', '', '666'),
(124, '上中', '	\r\n過盡山前後，艱阻往來難。若得清風便，肩舟過遠山', '', '611'),
(125, '上中', '君子升，小人阻，征戰生離苦。前途自有吉人逢，事可憂?要營求', '', '613'),
(126, '中中', '久歷驚濤，東風便好。太平身退，目下尚早', '', '615'),
(127, '下下', '休眷戀，奔前程。終鬧亂，出門庭', '', '622'),
(128, '上上', '用則行，舍則藏。一騎出重關，佳音咫尺間', '', '624'),
(129, '下下', '渴穿井，飢畫餅。漫勞心，如捕影。遇龍虎，方可省', '', '626'),
(130, '上上', '鹿逐雲中出，人從月下歸。新欣盈笑臉，不用皺雙眉', '', '631'),
(131, '下中', '	\r\n入而易，出而難。厭厭到再三，交加意不堪', '', '633'),
(132, '上上', '	\r\n積德施功蔭子孫，殺牛祭神及西鄰。功名兩字垂成日，回首山前萬物新', '', '635'),
(133, '上中', '事遲志速，而且反複。直待歲寒，花殘果熟', '', '642'),
(134, '上上', '乘馬班如，求婚媾吉。隨時諧義，缺月重明', '', '644'),
(135, '下下', '	\r\n不足不足，難伸心曲。野塘雨過月如鈎，夢斷邯鄲眉黛蹙', '', '646'),
(136, '中中', '月在雲間，昏迷道路。雲散月明，漸宜進步', '', '651'),
(137, '下下', '安靜事難疑，雲中一雁飛。桃花逢驟雨，水畔女頻啼', '', '653'),
(138, '上中', '美在甘，甘有美。始有終，終有始', '', '655'),
(139, '下中', '岸闊水深舟易落，路遙山險步難行。行行自有通津日，目下香消月未明', '', '671'),
(140, '下下', '事慮淹留，人不徹頭。往來閉塞，要見無由', '', '673'),
(141, '中中', '道路任招呼，風波一點無。時間心緒亂，全仗貴人扶', '', '675'),
(142, '中中', '一人去，一人來。清風明月兩相猜，獲得金鱗下釣台', '', '682'),
(143, '下中', '無端風雨吹春去，落盡枝頭桃李花。枕畔有人歌且笑，教君心事亂如麻', '', '684'),
(144, '下下', '喜未穩，愁已遭。大雨狂風臨古木，人人盡道不堅牢', '', '686'),
(145, '中中', '易非易，難非難。忽然平地起波瀾，歌笑須教三兩番', '', '772'),
(146, '中中', '山山有路，有終有始。似月如花，守成而已', '', '774'),
(147, '上上', '寶鏡無塵染，金貂已剪裁。也逢天意合，終不染塵埃', '', '776'),
(148, '中中', '蝸角蠅頭利，而今已變通。草頭人笑後，宜始不宜終', '', '712'),
(149, '下中', '鵲噪高枝上，人行古渡頭。半途不了事，日暮轉生愁', '', '714'),
(150, '上上', '事有喜，物有光。始終好商量，壺中日月長', '', '716'),
(151, '下中', '	\r\n喜喜喜，終防否?獲得驪龍頷下珠，忽然失卻還沉水', '', '721'),
(152, '中中', '事未完，心未安。疑慮久，得安然', '', '723'),
(153, '中中', '莫言樴棘惡，終為鸞鳳栖。目前應有待，何用早躊躇', '', '725'),
(154, '上上', '月已圓，花再發。事悠悠，無不合', '', '732'),
(155, '上中', '曲中應有直，心事還成戚。雲散月重圓，千里風帆急', '', '734'),
(156, '上上', '明月重圓，顏色欣然。風雲相送，和合萬年', '', '736'),
(157, '下下', '	\r\n紅葉無顏色，凋零一夜風。鄰(林)鸛醒午夢，心事總成空', '', '741'),
(158, '下下', '	\r\n事宜休，理多錯。日掩雲中，空成擔閣(耽擱)', '', '743'),
(159, '下中', '進不安，退不可。上下相從，明珠一顆', '', '745'),
(160, '上中', '暗去又明來，憂心事可諧。終須成一笑，日下莫疑猜', '', '752'),
(161, '中中', '可以委，可以託。事遲遲，無差錯', '', '754'),
(162, '上中', '深淵魚可釣，幽林鳥可獲。只用久長心，不用生疑惑', '', '756'),
(163, '下中', '門外起干戈，親朋兩不和。朱衣歸日月，始覺笑呵呵', '', '761'),
(164, '下下', '娶女無攸利，花間又及秋。嚴霜將荐至，退步不存留', '', '763'),
(165, '下下', '乘病馬，上危坡。防失跌，見蹉跎', '', '765'),
(166, '下下', '上接不穩，下接不和。相纏相擾，平地風波', '', '781'),
(167, '上上', '玉石獶蒙味，那堪小悔多!終無咎，笑呵呵', '律師事務所佳，事情多，慎用', '783'),
(168, '中中', '圓又缺，缺又圓。低低密密要周旋，時來始見緣', '', '785'),
(169, '上上', '師征千里福綿綿，造化生成信自然，功名得就神明助，蛇鬼相逢自變遷', '', '882'),
(170, '下下', '路不通，門閉塞。謹慎提防，月藏雲黑', '', '884'),
(171, '下中', '月缺花殘，鏡破釵分。休來休往，事始安寧', '', '886'),
(172, '上中', '東邊事，西邊成。風物月華明，高樓弄笛聲', '1708 0025 常用', '811'),
(173, '下下', '和不和，同不同。翻雲覆雨幾成空，進退須防終少功', '', '813'),
(174, '上上', '添一人，獲一寶。事團圓，門外討', '', '815'),
(175, '上上', '和合事，笑談成。喜音在半程，平步踏青雲', '', '822'),
(176, '上上', '事團圓，物間旋。一往一來，平步青天', '0028 常用', '824'),
(177, '上中', '	\r\n朦朧秋月映朱扃，林處鶴(鸛)聲遠處生。自有貴人相接引，何須巧語似流鶯', '', '826'),
(178, '中中', '乘翼遙飛去，皆因避遠行。一途經濟意，又是滿園春', '', '831'),
(179, '上中', '	\r\n虛名虛位久沉沉，祿馬當頭未見章。一片彩雲秋後至，去年風物一時新', '', '833'),
(180, '下下', '重關深鎖閉，謹慎要提防。小節不知戒，因循成大殃', '', '835'),
(181, '上中', '悲後笑嘻嘻，中行道最宜。所求終有望，不必皺雙眉', '', '842'),
(182, '上中', '臨淵放釣，清絕點埃。巨鰲隨得，何用疑猜', '1216 常用', '844'),
(183, '下下', '進步且徘徊，春風柳絮催。水邊行客倦，枕畔有憂懷', '', '846'),
(184, '上上', '明月為鈎，清風作線。舉網煙波，錦鱗易見(現)', '', '851'),
(185, '上中', '	\r\n舟離古渡月離雲，人出重關好問津。且向前行求去往，何須疑慮兩三旬', '', '853'),
(186, '上上', '佳信至，見笑顏。飛騰一去，披雲上天', '', '855'),
(187, '上上', '秋月雲開后，薰風雨過時。若逢楚國舊知已，等閑一荐不須疑', '', '862'),
(188, '下中', '	\r\n青氈終復舊，枝上果生風。莫為一時喜，還疑此象凶', '', '864'),
(189, '上上', '謀已定，事何憂?金鱗已上鈎，功名一網收', '', '866'),
(190, '下中', '恐怕正憂煎，憂非滿目前。若逢明鑒照，撓括信空傳。', '', '871'),
(191, '上中', '勞心慢勞心，勞心終有成。清風來助力，歡笑見前程', '', '873'),
(192, '下中', '鶯語燕呢喃，花開滿院間。倚欄春夢覺，無語斂愁顏', '', '875');
